async function query() {
  const { page, sort, filters } = $data;
  if (filters.workDay != undefined) {
    filters.workDay = filters.workDay.split(' ')[0];
  }
  const params = Object.assign({
  	['(like)workDay_lk']: filters.workDay,
  }, page, sort)
  $data.loading = true
  await $dde.get('6703454f60944018a77fddc55cb247f8', { params }).then(res => {
    res.objList.forEach(item => {
      item.workDay = item.workDay.split(' ')[0];
      if(item.dayType != undefined) {
        item.dayTypeDesc = item.dayType === 'B' ? '班' : '休';
      }
    })
    $data.list = res.objList;
    $data.page = res.pageDesc;
  });
  $data.loading = false
}

